import Head from "next/head";
import Container from "../components/Container";


const About = () => {
    return (  
    <div>
        <Container/>
        <Head>
            <title>Next.js project - About</title>
        </Head>
        <h1>About</h1>
    </div>
    )
    
}

export default About;
